import React, { useState } from 'react';
import ProfileForm from './Components/ProfileForm'; // CORRECT path

function App() {
  const [output, setOutput] = useState(null);

  function handleSubmit(formData) {
    // Here you could send AJAX/Fetch to backend or just show output
    setOutput(formData);
  }

  return (
    <div>
      <ProfileForm onSubmit={handleSubmit} />
      {output && (
        <div>
          <h3>Output:</h3>
          <pre>{JSON.stringify(output, null, 2)}</pre>
        </div>
      )}
    </div>
  );
}

export default App;
